import styled from 'styled-components';

export const Div = styled.div`
  width: 100%;
  margin-left: auto;
  margin-right: auto;
  margin-top: 1.5rem;
  position:absolute;
  text-align:center;
  `;

export const Img = styled.img`
  width: 15.5%;
`;

export const Counter = styled.h1`
  margin-top: 1.5rem;
  color: #32b8bf;
`;
